css:
.header-view {
  position: fixed;
  width: 100%;
  z-index: 10;
  position: relative;
}
.header-view .heading-close {
  color: #7198b7;
}
.header-view .heading-title {
  padding-left: 6px;
}
.header-view .heading-status {
  padding-left: 9px;
}
.header-view .icon-alert {
  color: #ff9740;
}
.header-view .icon-check {
  color: #6ed300;
}
.header-view .icon-hourglass {
  color: #788d9e;
}
.header-view .icon-stop {
  color: #ff9740;
}
.script-view {
  overflow: scroll;
  height: 300px;
  margin-bottom: 0px;
}
.script-view .panel-body pre {
  background: #eff1f5;
  color: #788d9e;
}
.script-view .stderr {
  color: #ff9740;
}
.script-view .line {
  border-radius: 0px;
  margin: 0px;
  padding: 0px;
}
